package com.root7325.javabs.laser.protocol.packets.server;

import com.root7325.javabs.entity.player.Player;
import com.root7325.javabs.laser.protocol.packets.MessageType;
import com.root7325.javabs.laser.protocol.packets.PiranhaMessage;
import com.root7325.javabs.utils.LaserByteBuf;
import lombok.AllArgsConstructor;

/**
 * @author root7325 on 17.06.2025
 */
@AllArgsConstructor
public class OwnHomeDataMessage extends PiranhaMessage {
    private final Player player;

    @Override
    public void decode(LaserByteBuf in) {

    }

    @Override
    public void encode(LaserByteBuf out) {
        out.writeVInt(0);

        out.writeVInt(player.getStats().getScore());
        out.writeVInt(player.getStats().getHighestScore());
        out.writeVInt(0);

        out.writeVInt(0);
        out.writeVInt(1);
        out.writeVInt(0);

        out.writeDataReference(player.getSettings().getThumbnail());

        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);


        out.writeBoolean(false);

        out.writeVInt(1);

        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);

        out.writeVInt(0);
        out.writeVInt(0);

        out.writeBoolean(false);
        out.writeVInt(1);
        out.writeBoolean(true);

        out.writeVInt(0);
        out.writeVInt(0);
        out.writeBoolean(false);

        out.writeVInt(0);

        out.writeBoolean(false, false, false, true);

        out.writeVInt(2);
        out.writeVInt(0);
        out.writeVInt(2);
        out.writeVInt(2);

        out.writeBoolean(false);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);

        out.writeVInt(0);

        out.writeVInt(0);

        out.writeVInt(0);
        out.writeVInt(100);
        out.writeVInt(10);
        out.writeVInt(30);
        out.writeVInt(3);
        out.writeVInt(80);
        out.writeVInt(10);
        out.writeVInt(50);
        out.writeVInt(1000);
        out.writeVInt(500);
        out.writeVInt(0);
        out.writeVInt(999900);

        out.writeArrayVInt(0, 30, 80, 170, 350, 0);

        out.writeVInt(1);
        out.writeVInt(1);

        out.writeVInt(1);
        out.writeVInt(1);
        out.writeVInt(1);
        out.writeVInt(0);
        out.writeVInt(5000);
        out.writeVInt(25);
        out.writeDataReference(15, 7);
        out.writeVInt(3);
        out.writeString();
        out.writeVInt(0);
        out.writeVInt(0);

        out.writeVInt(0);

        out.writeArrayVInt(20, 35, 75, 140, 290, 480, 800, 1250);
        out.writeArrayVInt(1, 2, 3, 4, 5, 10, 15, 20);
        out.writeArrayVInt(10, 30, 80);
        out.writeArrayVInt(6, 20, 60);
        out.writeArrayVInt(20, 50, 140);
        out.writeArrayVInt(150, 200, 1200);

        out.writeVInt(0);
        out.writeVInt(621);
        out.writeHex(
                "");

        out.writeVInt(200);
        out.writeVInt(20);
        out.writeVInt(8640);
        out.writeVInt(10);
        out.writeVInt(0);
        out.writeBoolean(true);
        out.writeBoolean(true);
        out.writeBoolean(false);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);

        out.writeLong(0, player.getId());
        out.writeVInt(0);
        out.writeVInt(0);

        out.writeVLong(0, player.getId());
        out.writeVLong(0, player.getId());
        out.writeVLong(0, player.getId());

        out.writeString(player.getSettings().getUsername());
        out.writeBoolean(true);
        out.writeInt(-1);

        out.writeVInt(8);

        {
            out.writeVInt(player.getHeroes().size());
            player.getHeroes().forEach(hero -> {
                out.writeDataReference(hero.getCard());
                out.writeBoolean(true);
            });
        }

        {
            out.writeVInt(player.getHeroes().size());
            player.getHeroes().forEach(hero -> {
                out.writeDataReference(hero.getChar());
                out.writeVInt(hero.getScore());
            });
        }

        {
            out.writeVInt(player.getHeroes().size());
            player.getHeroes().forEach(hero -> {
                out.writeDataReference(hero.getChar());
                out.writeVInt(hero.getHighestScore());
            });
        }

        out.writeVInt(0);

        {
            out.writeVInt(player.getHeroes().size());
            player.getHeroes().forEach(hero -> {
                out.writeDataReference(hero.getChar());
                out.writeVInt(hero.getUpgradiumPoints());
            });
        }

        {
            out.writeVInt(player.getHeroes().size());
            player.getHeroes().forEach(hero -> {
                out.writeDataReference(hero.getChar());
                out.writeVInt(hero.getPowerLevel());
            });
        }

        out.writeVInt(0);

        {
            out.writeVInt(player.getHeroes().size());
            player.getHeroes().forEach(hero -> {
                out.writeDataReference(hero.getChar());
                out.writeBoolean(hero.isSeen());
            });
        }

        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(0);
        out.writeVInt(2);
        out.writeVInt(0);
    }

    @Override
    public MessageType getMessageType() {
        return MessageType.OwnHomeData;
    }
}
